package Tree;import Temp.Temp;import java.util.LinkedList;public class TEMP extends Exp1 {    public Temp temp;    public TEMP(Temp t) { temp=t; }    public LinkedList<Exp1> kids() { return new LinkedList<Exp1>(); }    public Exp1 build(LinkedList<Exp1> kids) { return this; }    public void accept(IntVisitor v, int d) { v.visit(this, d); }    public Temp accept(CodeVisitor v) { return v.visit(this); }    public <R> R accept(ResultVisitor<R> v) { return v.visit(this); }}